import { useEffect } from 'react'
import { Item } from '../Item/Item'




export const ItemList = ({items}) => {
  useEffect(() => {
    console.log(items)
  }, [items])

  return (

    <div>

          {items.map(item => (
            <Item  key={items.id} item={items} />
          ))}

    </div>
)
}
